import React, { useState } from 'react';
import styles from './Deep.module.css';

const Deep = () => {
  const [count, setCount] = useState(1);
  const [mouseIn, setMouseIn] = useState(false);
  const [isHedisExpanded, setIsHedisExpanded] = useState(false); // Define isHedisExpanded state

  const demo = () => {
    if (mouseIn) return;
    const element = document.getElementById('demo' + count);
    if (element) {
      element.classList.toggle(styles['deep-hover']);
      setCount(prevCount => prevCount + 1);
    }
  };

  const reset = () => {
    setCount(1);
    const hovers = document.querySelectorAll(`.${styles['deep-hover']}`);
    hovers.forEach(hover => hover.classList.remove(styles['deep-hover']));
  };

  const toggleHedisExpansion = () => {
    setIsHedisExpanded(prevState => !prevState); // Toggle the isHedisExpanded state
  };

  document.addEventListener('mouseover', () => {
    setMouseIn(true);
    reset();
  });

  setTimeout(demo, 500);
  setTimeout(demo, 700);
  setTimeout(demo, 900);
  setTimeout(reset, 2000);
  setTimeout(demo, 2500);
  setTimeout(demo, 2750);
  setTimeout(demo, 3050);

  return (
    <nav className={styles['deep-nav']}>
      <menu className={styles['deep-menu']}>
        <li className={styles['deep-menuitem']} id="demo1">
          {/* <a>drop</a> */}
          <menu className={styles['deep-menu']}>
            <li><a>Deep Dive Session</a></li>
            <li className={styles['deep-menuitem']} id="demo2">
